  \"Environmental contaminants in brook trout (Salvelinus fontinalis) from Cove Brook
  and two tributaries of the Sheepscot River\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  7,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:48:53.609412\",\n\t\"name\": \"environmental-contaminants-in-brook-trout-salvelinus-fontinalis-from-cove-brook-and-two-tr\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Atlantic salmon (Salmo salar) is a
  federally-listed endangered species with a Distinct Population Segment (DPS) designated
  in Maine. In July 2006, thirty-six brook trout (Salvelinus fontinalis) were collected
  from tributaries of two Maine rivers within the DPS and used as surrogates for assessing
  potential contaminant exposure in Atlantic salmon parr. Eighteen trout were collected
  from two reaches in Cove Brook, a tributary of the Penobscot River, and 18 fish
  were collected from two tributaries of the Sheepscot River - Finn Brook and Weaver
  Brook. Brook trout were analyzed as whole-body samples (minus livers and a gill
  portion) for 22 organochlorine compounds and 19 trace elements. Liver and gill tissues
  from trout were extracted for a U.S. Geological Survey investigation to measure
  biochemical response. The results of this analysis are described in this report.\",\n\t\"license_title\":
